import Database from './Images/db.jpg';

const Sdata =[
    {
        imgsrc:Web,
        title:'Web Development'
    },
    {
        imgsrc:App,
        title:'App Development'
    },
    {
        imgsrc:Network,
        title:'Networking'
    },
    {
        imgsrc:Science,
        title:'Science and Technology'
    },
